import { getidrelation } from '@/api/model'
import result from './components/result.vue'
export default {
  components: {
    result
  },
  data(){
    return{
      project_id: '',
      sort_id: null,
      id_list: [],
      sort_list: []
    }
  },
  methods:{
    init_projectId:function(){
      let that = this
      getidrelation().then(res=>{
        let data = res.data
        for (let i=0; i<data.length; i++){
            that.id_list.push(data[i])
        }
      })
    },
    handleChildEvent:function(val){
      this.sort_list = []
      for (let i=0; i<val.length; i++){
        let dict = {}
        dict['value'] = val[i]
        dict['label'] = val[i]
        this.sort_list.push(dict)
      }
    },
  },
  mounted(){
    this.init_projectId()
  }
}
